/**
 * Create a footer in the style of V2.
 * @param {*} prop
 */
import React from "react";
import Home from "./homeActive.png"

function Footer(prop) {
    return( <footer>
            <div className="left"><a href="./2/login">Login</a></div>
            <p className="center"><img className="icon" src={Home}></img></p>
            <div className="right"><a href="./create">Create Account</a></div>
          </footer> );
}

export default Footer;
